  constructor(){
    super();
    this.state = {
      Number :1,
    }
    this.eventHandler = this.eventHandler.bind(this);
  }
  eventHandler(){
       this.setState({Number:111})
  }
  render(){
     return(
      <div className='container'>
        <h1>{this.state.Number}</h1>
        <button onClick={this.eventHandler()} type="button" class="btn btn-primary">click</button>
      </div>    
     )
  }
}

export default App;
